import logo from './logo.svg';
import './App.css';
import gogeta from './images/gogeta.jpg'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={gogeta} className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
